  false,\n\t\"url\": null,\n\t\"notes\": \"This is an external link to the CHATS system
  on the website of MIEMSS, Maryland Institute for Emergency Medical Services Systems.
  CHATS is updated every 60 seconds. CHATS shows and generates reports on the current
  status of hospitals and counties in Maryland, including real-time listings of Yellow
  Alerts and Red Alerts by hospital. The backing data are in an internal MIEMSS SQL
  database. The CHATS site is powered by Global Emergency Resources, LLC.\",\n\t\"license_title\":
